					"start script": ~set(event_handlers.finished_load_level, q[[
                //Initial Setup
                set(msg_dialogs, {a:da, b:db, c:dc, 'd':dd, e:de}), //d is the die operator

                //We must clear any widgets we've set up when we hit the reset button.
                set(event_handlers.quick_load, q[[
                        map(level.chars, clear_widgets(value)),
                        select_piece('ct-metatrack-13'),
                        ]]),

                execute(buttons.navg5, set_widgets(da)),
                set(event_handlers.ctrl_high, q[[
                        clear_widgets(buttons.navg5),
                        execute(buttons.undo, set_widgets(msg_dialogs.b)),
                        set(event_handlers.ctrl_high, 'null'),
                        set(event_handlers.Done_db, q[[
                                clear_widgets(buttons.undo),
                                execute(buttons.reset, set_widgets(msg_dialogs.c)),
                                ]]),
                        set(event_handlers.Done_dc, q[[
                                clear_widgets(buttons.reset),
                                add(buttons.return.z, 1), //Could overlap top of toolbox, badly.
                                execute(buttons.return, set_widgets(msg_dialogs['d'])),
                                ]]),
                        set(event_handlers.Done_dd, q[[
                                clear_widgets(buttons.return),
                                add(self.z, 100),
                                set_widgets(msg_dialogs.e),
                                ]]),
                        set(event_handlers.Done_de, q[[
                                clear_widgets(self),
                                ]]),
                        ]]),

                ]


                where //Dialogs and dialog objects.
                da = dialog(
                        self, {
                                type: 'dialog',
                                cursor: [15, 15],
                                rect: [-200,buttons.navg5.img_h/(-2),200,100],
                                background_frame: 'empty_window',
                                children: [
                                        {
                                                xy: [18, 18],
                                                type: 'label',
                                                text: 'Press the up arrow
to go up a level.',
                                                size:18,
                                        },
                                ],
                        }),
                db = dialog(
                        self, {
                                type: 'dialog',
                                cursor: [15, 15],
                                rect: [0,buttons.redo.img_h,300,100],
                                background_frame: 'empty_window',
                                children: [
                                        {
                                                xy: [18, 18],
                                                type: 'label',
                                                text: 'These buttons control
undo/redo.',
                                                size:18,
                                        },{
                                                xy: [18, 82],
                                                type: 'button',
                                                id: 'a',
                                                padding: [12,6],
                                                label: {type: 'graphical_font_label', text:'Okay.', font: 'default', size: 1},
                                                on_click: q(fire_event(level.player, 'Done_db')),
                                        },
                                ],
                        }),
                dc = dialog(
                        self, {
                                type: 'dialog',
                                cursor: [15, 15],
                                rect: [0,buttons.reset.img_h,300,100],
                                background_frame: 'empty_window',
                                children: [
                                        {
                                                xy: [18, 18],
                                                type: 'label',
                                                text: q(This button resets the level.
(It's an undoable action.)),
                                                size:18,
                                        },{
                                                xy: [18+buttons.undo.x-buttons.reset.x, 82],
                                                type: 'button',
                                                id: 'a',
                                                padding: [12,6],
                                                label: {type: 'graphical_font_label', text:'Okay.', font: 'default', size: 1},
                                                on_click: q(fire_event(level.player, 'Done_dc')),
                                        },
                                ],
                        }),
                dd = dialog(
                        self, {
                                type: 'dialog',
                                cursor: [15, 15],
                                rect: [0,buttons.return.img_h,400,100],
                                background_frame: 'empty_window',
                                children: [
                                        {
                                                xy: [18, 18],
                                                type: 'label',
                                                text: q(Return to the main map. The game is
saved when you return to the main map.),
                                                size:18,
